</template>

<script>
import ToasterWord from './ToasterWord.vue';
import axios from 'axios';
import CreateLogsWord from './CreateLogsWord.vue';
import LoaderWord from './LoaderWord.vue';
import chevron_down from './assets/menu/chevron_down.png';
import chevron_up from './assets/menu/chevron_up.png';

export default {
    name: 'ItemDetail',
    props: ['itemName'],
    components: {
        ToasterWord,
        CreateLogsWord,
        LoaderWord,
  },
  data() {
    return {
        itemData:{
            itemNameNew : ''
        },
        chevron_down,
        chevron_up,
        restaurantData: '',
        itemsNewData1:[],
        itemsNewData: [
                {
                  "id": "3584309148",
                  "name": "dal kichadi",
                  "price": 120,
                  "description": "Papad,Pickles",
                  "ingredients": "Water Bottle",
                  "rating": 5,
                  "showDetails": false,
                  "image": "data:image/jpeg;base64,",
                  "status": "added"
                },
                {
                  "id": "1542176173",
                  "name": "Chicken Thali",
                  "price": 150,
                  "description": "chicken, Roti, rice",
                  "ingredients": "Rassa, Tamada, Pandhara",
                  "rating": 5,
                  "showDetails": false,
                  "image": "data:image/jpeg;base64,",
                  "status": "added"
                },
                {
                    "id": "5116867028",
                    "name": "Anda Thali",
                    "price": 100,
                    "description": "Eggs ,Chapati, Rice",
                    "ingredients": "Rassa, Papad",
                    "rating": 5,
                    "showDetails": false,
                    "image": "data:image/jpeg;base64,",
                    "status": "added"
                  },
                  {
                    "id": "1822869471",
                    "name": "Burger",
                    "price": 80,
                    "description": "N/A",
                    "ingredients": "N/A",
                    "rating": 5,
                    "showDetails": false,
                    "image": "data:image/jpeg;base64,",
                    "status": "added"
                  },
                  {
                    "id": "8513733851",
                    "name": "Veg Thali",
                    "price": 80,
                    "description": "Choole Muttor, Bhendi, Aloo",
                    "ingredients": "3 Chapati, 2 Sabji, Dal, rice, papad",
                    "rating": 5,
                    "showDetails": false,
                    "image": "data:image/jpeg;base64,",
                    "status": "added"
                  },
                  {
                    "id": "3618878616",
                    "name": "pizza",
                    "price": 110,
                    "description": "Red Chilly",
                    "ingredients": "N/A",
                    "rating": 5,
                    "showDetails": false,
                    "image": "data:image/jpeg;base64,",
          "status": "added"
        },
      ],
        menuItemsSave:[],
        cartItemsSave:[],
        isLoading: false,
        isSubmitting: false,
    };
  },
  computed: {
    receivedData() {
        return this.$router.state.passedData || {};
    }
  },
  mounted() {
    this.toaster = this.$refs.toaster;
    this.isLoading = true;
    this.fetchMenuItems();
    setTimeout(() => {
        this.isLoading = false;
      }, 2000);
  },
  methods:{
    async fetchMenuItems(){
        this.isLoading = true;
        try {
        const response = await axios.get('http://localhost:3000/auth/fetch-MenuItem');
        this.menuItemsSave = response.data;
        
      } catch (error) {
       // console.log(error)
      } 
      finally {
            this.isLoading = false;
        }
        this.itemData.itemNameNew = this.itemName.charAt(0).toUpperCase() + this.itemName.slice(1).toLowerCase();
        const storedRestaurant = localStorage.getItem('selectedRestaurant');
        if (storedRestaurant) {
            this.restaurantData = JSON.parse(storedRestaurant);
        }
             this.itemsNewData = this.itemsNewData.map(item => ({
            ...item,
            quantity: 0, 
            nameNew: this.itemData.itemNameNew,
            }));
   
    },
    addItem(item) {
        item.quantity++;
      },
      deleteItem(item) {
        if (item.quantity > 0) {
          item.quantity--;
        }
      },
      async addToCart() {
        const cartItems = this.itemsNewData.filter(item => item.quantity > 0);
        localStorage.setItem("cartItems", JSON.stringify(cartItems));
        this.$emit("update-cart-count", cartItems.length);
            try {
            const response = await axios.post('http://localhost:3000/auth/add-cart',  cartItems, { headers: {
                'Content-Type': 'multipart/form-data'
                }
            });
            this.cartItemsSave = response.data;   
            } catch (error) {
               //console.log(error)
            }
        if (cartItems.length > 0) {
            this.isSubmitting = true;
            setTimeout(() => {
                this.isSubmitting = false;
               this.$router.push({ name: "Cart" });
            }, 500);
            } else {
                this.showToast('No items in the cart with quantity greater than 0!', 'info');
            }
             this.$refs.createLogsComponent.createLog('Items added to Cart', 'Cart-Add', this.itemsNewData.id);
       
      },
      addMenuButton(){
        this.isSubmitting = true;
        setTimeout(() => {
            this.isSubmitting = false;
            this.$router.push({ name: "Menu" });
        }, 200);
      },
      showToast(msg, status) {
        if (this.toaster) {
            this.toaster.show(msg, status);
        } 
    },
    addLogToLogs(log) {
      console.log('Log Created:', log);
    },
    toggleAccordion(id) {
    this.itemsNewData = this.itemsNewData.map(item => {
      if (item.id === id) {
        item.showDetails = !item.showDetails;
      }
      return item;
    });
  },
  },
};
</script>
